  var hitList = new Array();

  if ( isAllCaps) { // user wants exact match to displayable key or alphabet1, while ignoring case
    var searchRE = new RegExp( "^" + searchREstring + "$", "gim");
    for ( var j = 0; j < subject.length; j++ ) {
      if ( subject[ j][ displayableKey].search( searchRE) != -1) {
        hitList.push( j);
        continue;
      }
      if ( subject[ j][ alphabet1].search( searchRE) != -1) {
        hitList.push( j);
      }
    }
  } else { // user wants to match any substring, while ignoring case
    var searchRE = new RegExp( searchREstring, "gim");
    for ( var j = 0; j < subject.length; j++ ) {
      if ( subject[ j][ displayableKey].search( searchRE) != -1) {
        hitList.push( j);
        continue;
      }
      if ( subject[ j][ descriptor].search( searchRE) != -1) {
        hitList.push( j);
      }
    }
  }
  
  function hitCompare( a, b) {
    var aNatLangTopicType = subject[ a][ natLangTopicType]
    var bNatLangTopicType = subject[ b][ natLangTopicType]
    if ( aNatLangTopicType > bNatLangTopicType) {
      return 1;
    } else if ( aNatLangTopicType < bNatLangTopicType) {
      return -1;
    } else {
      var aDescriptor = subject[ a][ descriptor]
      var bDescriptor = subject[ b][ descriptor]
      if ( aDescriptor > bDescriptor) {
        return 1;
      } else if ( aDescriptor < bDescriptor) {
        return -1;
      } else {
        return 0;
      }
    }
  }

  hitList.sort( hitCompare);

  function underLine( procString) {
    searchRE.lastIndex = 0;
    foundList = [];
    while( ( result = searchRE.exec( procString)) != null) {
      foundList.push( [result.index, searchRE.lastIndex, result[ 0]]);
    }
    if ( foundList.length == 0) {
      return procString;
    }
    var lastindex = 0;
    var returnString = "";
    for ( i = 0; i < foundList.length; i++) {
      returnString = returnString + procString.substr( lastindex, ( foundList[ i][ 0] - lastindex));
      returnString = returnString + "<U>" + foundList[ i][ 2] + "</U>";
      lastindex = foundList[ i][ 1]
    }
    returnString = returnString + procString.substr( lastindex)
    return returnString;
  }

